import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const Home = () => {
  return (
    <Container>
      <Row>
        <Col>
          <h2>Welcome to My Portfolio</h2>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla convallis libero in urna dapibus, ac iaculis ipsum interdum.</p>
        </Col>
      </Row>
    </Container>
  );
}

export default Home;
